import React from "react";
import "./Homepage.css";

function sayHello() {
  alert("You clicked me!");
}

function Homepage() {
  return (
    <div className="homepage">
      <div className="gcp">Google Cloud Platform</div>
      <Button onClick={sayHello}>Disabled Button</Button>
    </div>
  );
}

export default Homepage;
